import { Link } from "react-scroll";
import logo from "../images/logo1.png";

function Navbar() {
  const [nav, setnav] = useState(false);

  const chnageBackground = () => {
    if (window.scrollY >= 50) {
      setnav(true);
    } else {
      setnav(false);
    }
  };
  return <div></div>;
}

export default Navbar;
